summary:
Accomplished software developer with over ten years of experience in developing web applications. Throughout my career, I’ve created large enterprise applications that can handle millions of requests per day, web forms with hundreds of fields and complex embedded calculations with support of version control and concurrency editing conflicts handling and applications that can process big sets of data and at the same time provide a responsive user interface.

•	Designing system architecture and its components;
•	Developing web application backend, REST and WCF services; 
•	Developing client-side functionality;
•	Multi-threaded and parallel programming of high-performance solutions; 
•	Creating proofs-of-concept, load testing, profiling, optimization;
•	Designing full-text search solutions;
•	Performing design and code reviews;
•	Scope decomposition and estimation;
•	Leading a team of developers;
•	Hands-on experience of Agile (Scrum) and Spiral methodologies.

As a passionate, dynamic learning architect, I led the faculty at Southern Methodist University Cox School of Business through the transition of face-to-face to remote teaching during the COVID-19 pandemic.  I provided essential solutions and training for faculty in learning theories, assessments, instructional design, and technology integration.  

My experience encompasses:
•	Twenty-five+ years extensive experience in technology;
•	Eight years in leading IT projects through design, implementation, and management;
•	Ten years assessing, creating, and leading training programs;
•	Ten years in education to include instruction, assessment, curriculum development, instructional design, and technology integration. 

As a leader in instructional design and professional development, I have managed and led professional development and learning programs. Additionally, I am passionate about creating seamless technology environments that empower users to become effective in their position through cutting-edge technology, efficient business systems, exceptional technical support, and professional development.

SUMMARY OF QUALIFICATIONS
Excellent communicator with advanced organizational skills; proven ability to learn quickly and handle confidential information; comprehensive knowledge of Mental Health therapy programs and Mental Health Skill Building services.  Strong background in managing mental health interventions for at-risk youth, proven ability to read and interpret policies applicable to Mental Health Skill Building (MHSB/IIH) services, effective in case management and recordkeeping proficiencies.

As a highly qualified mental health care provider with a proven background in case management and recordkeeping proficiencies coupled with an extensive comprehensive knowledge of Mental Health therapy programs and Mental Health Skill Building services makes me a great candidate for your organization. 

Having a strong background in managing mental health interventions for at-risk youth, proven ability to read and interpret policies applicable to Mental Health Skill Building (MHSB/IIH) services, and a Master degree in Community Counseling further demonstrates my ability to: 

•	Develop and implement Client-Center Individual Treatment Plans (ISPs);
•	Maintain genuine positive regard at all times, not becoming judgmental of the individual’s behavior;
•	Provide Case Coordination (connecting the client with community health/mental health services and other community resources, advocating whenever necessary);
•	Ability to manage crisis prevention, intervention and de-escalations 

I am looking for an employment opportunity coupled with a Residential Counselor position with a company that will further strengthen my skills, experiential knowledge and clinical acumen to become a Professional Counselor. Please feel free to contact me at 804-300-1315.

